class Page():

    def __init__(self, _current_page_number, _current_page_sort):
        self.current_page_sort = _current_page_sort
        self.current_page_number = int(_current_page_number)

        if self.current_page_sort == "r_page":
            self.r_article = ArticleR.objects.all()
            self.paginator = Paginator(self.r_article, 8)
        elif self.current_page_sort == "manual_page":
            self.manual_guide = GuideManual.objects.all()
            self.paginator = Paginator(self.manual_guide, 8)
        elif self.current_page_sort == "link_page":
            self.link = Link.objects.all()
            self.paginator = Paginator(self.link, 8)

    def get_current_page_number(self):
        return self.current_page_number

    def get_current_page(self):
        self.start_index = self.paginator.count - \
            8 * (self.current_page_number)
        self.end_index = self.paginator.count - \
            8 * (self.current_page_number - 1)
                ## page_sort = r_page, manual_page, link_page 인듯
        if self.current_page_sort == "r_page":
            if self.start_index >= 0:
                self.page = self.r_article[self.start_index:self.end_index]
            elif self.start_index < 0:
                self.page = self.r_article[:self.end_index]
        elif self.current_page_sort == "manual_page":
            if self.start_index >= 0:
                self.page = self.manual_guide[self.start_index:self.end_index]
            elif self.start_index < 0:
                self.page = self.manual_guide[:self.end_index]
        elif self.current_page_sort == "link_page":
            if self.start_index >= 0:
                self.page = self.link[self.start_index:self.end_index]
            elif self.start_index < 0:
                self.page = self.link[:self.end_index]
        return self.page

    def get_total_page_range(self):
        return self.paginator.page_range

    def get_total_page_number(self):
        return self.paginator.num_pages

class InputKeggText(models.Model):

    input_kegg_text = models.TextField(blank=True)

class InputKeggTextForm(ModelForm):

    class Meta:
        model = InputKeggText
        fields = ['input_kegg_text']

    def __init__(self, *args, **kwargs):
        super(InputKeggTextForm, self).__init__(*args, **kwargs)
        self.fields['input_kegg_text'].widget.attrs.update({'id': 'textInput'})

